import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { InitialConfigRoutingModule } from './initial-config-routing.module';
import { ReactiveFormsModule } from '@angular/forms';

import { AccountSetupComponent } from './account-setup/account-setup.component';
import { PreferencesComponent } from './preferences/preferences.component';
import { ReviewAndSubmitComponent } from './review-and-submit/review-and-submit.component';
import { ActivationComponent } from '../auth/activation/activation.component';
import { VerificationPendingComponent } from '../auth/verification-pending/verification-pending.component';

import { CreateMasterAdminComponent } from '../auth/create-master-admin/create-master-admin.component';

import { BusinessSetupComponent } from './business-setup/business-setup.component';
import { WrapperComponent } from './wrapper/wrapper.component';

@NgModule({
  declarations: [
    AccountSetupComponent,
    PreferencesComponent,
    ReviewAndSubmitComponent,
    ActivationComponent,
    VerificationPendingComponent,
    WrapperComponent,
    BusinessSetupComponent,
    CreateMasterAdminComponent,
  ],
  imports: [
    CommonModule,
    ReactiveFormsModule,
    InitialConfigRoutingModule
  ]
})

export class InitialConfigModule { }
